import React from 'react';
import {Route} from 'react-router-dom';

import './App.css';
import HomePage from './pages/homepage/homepage.component.jsx';

const HatsPage = () => (
  <div>HAT PAGE</div>
)

function App() {
  return (
    <div>
      <Route exact path='/' component= {HomePage} />
      <Route path='/hats' component= {HatsPage} />
    </div>
  );
}

export default App;
